import React from 'react';
import './Menu.css';
import './akame.png';

export default class Menu extends React.Component{
    render(){
        return (
            <div id="container">
                <div>
                    <h1>React Sandbox</h1>
                    <img src='akame.png' width="500" height="300"></img>
                </div>
            </div>
        )
    }
}
